INSERT INTO `tbl_changelog` VALUES (1,'2011-08-16','1.0.0','Stabile Verkaufsversion per 16.08.2011'),(3,'2011-08-21','1.0.1','- Buchungen: Bug bei Darstellung der Leistungsnamen behoben<br/>- Angebotsvorlagen: Bug bei Darstellung der Leistungsnamen und der Regionsnamen behoben<br/>- Angebotsvorlagen: Leistung kann mehrfach auf einem Angebot vorkommen<br/>- Anfrage: Pflichtfelder bei Teilnehmer ver&auml;ndert'),(4,'2011-08-22','1.0.2','- Leisungen: Bug bei Darstellung der Partnernamen behoben<br/>\n'),(5,'2011-10-07','1.0.3','- Quartiere als Stammdatenpool eingef&uuml;gt. <br/>- Quartiere mit Buchung verbunden<br/>- Suggestion-Field in Leistungen und Angebotsvorlagen (Leistung) hinzugef&uuml;gt<br/>- Datenbank angepasst<br/>- Bug bei Leistungen (speichern) behoben'),(6,'2011-10-10','1.0.4','- Report Buchungen pro Region Quartiere hinzugef&uuml;gt <br />- Suche Buchungen pro Region auf Tasteneingabe ge&auml;ndert<br />'),(7,'2011-10-17','1.0.5','- bei Partner Felder f&uuml;r Titel,Fax und Homepage zugef&uuml;gt<br />\n- bei den Turnussen Spalte f&uuml;r Turnusnamen zugef&uuml;gt<br />\n- Buchungen Preis f&uuml;r Sch&uuml;ler und Begleitpersonen zuge&uuml;gt<br />\n- Bug bei Report nach Regionen behoben<br />\n- Preisfeld von den Leistungen entfernt<br />\n- Suggestion-Field in Quartiere und Angebotsvorlagen(Regionen) hinzugef&uuml;gt<br />\n- Suggestion-Field in Report nach Partnern zugef&uuml;gt'),(8,'2011-10-18','1.0.6','- Bug bei Buchung &uuml;bernehmen behoben.'),(9,'2011-10-28','1.0.7','- Report f&uuml;r Buchungsbest&auml;tigungen erstellt und implementiert.<br />\r\n- Tabelle bei Buchungen Leistungen chornologisch sortiert<br />\r\n- Suggestion Field bei Buchungen Leistungstabelle hinzugef&uuml;gt<br />\r\n- Anreise, Abreise Datum und Dauer in Tagen bei Report pro Region hinzugef&uuml;gt<br />\r\n- Bug bei der Suchfunktion Buchungen Name Schule behoben<br />\r\n'),(10,'2011-11-03','1.0.8','- Sortierung bei Report Region nach Startdatum<br />\r\n- Sortierung bei Report Reservierungsbest&auml;tigung nach Startdatum<br />\r\n- Anfrage Sortierung der Turnusse nach Datum<br />\r\n- Kundenverwaltung Bug bei Suchfunktion behoben<br />\r\n- Turnusse Sortierung nach Startdatum\r\n');
