--
-- Table structure for table `tbl_buchungen`
--

DROP TABLE IF EXISTS `tbl_buchungen`;

CREATE TABLE `tbl_buchungen` (
                                 `id_buchung` int(11) NOT NULL auto_increment,
                                 `id_angebotsvorlage` int(11) NOT NULL,
                                 `id_erste_ansprechperson` int(11) NOT NULL,
                                 `id_zweite_ansprechperson` int(11) default NULL,
                                 `id_ausschreibung` int(11) default NULL,
                                 `id_anfrage` int(11) NOT NULL,
                                 `datum` date NOT NULL,
                                 `buchungs_status` varchar(50) collate latin1_german1_ci NOT NULL,
                                 `name_klasse` varchar(100) collate latin1_german1_ci default NULL,
                                 `anzahl_weiblich` int(11) NOT NULL,
                                 `anzahl_maennlich` int(11) NOT NULL,
                                 `anzahl_begleitpers_weiblich` int(11) default NULL,
                                 `anzahl_begleitpers_maennlich` int(11) default NULL,
                                 `anzahl_vegetarier` int(11) default NULL,
                                 `anzahl_muslime` int(11) default NULL,
                                 `allergien` text collate latin1_german1_ci,
                                 `anmerkung_kunde` text collate latin1_german1_ci,
                                 `bemerkung` text collate latin1_german1_ci,
                                 `id_letzter_bearbeiter` int(11) NOT NULL,
                                 `letzte_bearbeitung` date NOT NULL,
                                 `aktiv` tinyint(1) NOT NULL,
                                 `id_quartier` int(11) default NULL,
                                 `abfahrtszeit_schule` time default NULL,
                                 `ankunftszeit_schule` time default NULL,
                                 `preis_schueler` decimal(10,2) default NULL,
                                 `preis_begleit` decimal(10,2) default NULL,
                                 `preis_bus` decimal(10,2) default NULL,
                                 PRIMARY KEY  (`id_buchung`),
                                 KEY `ix_buchungen` (`id_angebotsvorlage`,`id_erste_ansprechperson`,`id_zweite_ansprechperson`,`id_ausschreibung`,`id_anfrage`),
                                 KEY `id_erste_ansprechperson` (`id_erste_ansprechperson`),
                                 KEY `id_ausschreibung` (`id_ausschreibung`),
                                 KEY `id_zweite_ansprechpers` (`id_zweite_ansprechperson`),
                                 CONSTRAINT `tbl_buchungen_ibfk_1` FOREIGN KEY (`id_angebotsvorlage`) REFERENCES `tbl_angebotsvorlagen` (`id_angebotsvorlage`) ON UPDATE CASCADE,
                                 CONSTRAINT `tbl_buchungen_ibfk_2` FOREIGN KEY (`id_erste_ansprechperson`) REFERENCES `tbl_begleitperson` (`id_begleitperson`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=136 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


